// App.js or Router.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Index from './pages/Index'; // Landing page
import LoginPage from './pages/LoginPage'; // Login page
import RegisterPage from './pages/RegisterPage'; // Register page
import Dashboard from './pages/Dashboard'; // Dashboard content
import Layout from './components/Layout'; // Layout with top bar and sidebar
import './common.css';

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Public routes */}
        <Route path="/" element={<Index />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />

        {/* Protected routes (wrapped in Layout) */}
        <Route
          path="/dashboard"
          element={
            <Layout>
              <Dashboard />
            </Layout>
          }
        />
        {/* Add more pages here wrapped with Layout */}
      </Routes>
    </Router>
  );
};

export default App;
